const salesTrackerColumns = () => {
    const columns = 
        [
            {
                Header: 'Date Sold',
                accessor: 'dateSold',
            }, 
            {
                Header: 'Item Name',
                accessor: 'itemName',
            }, 
            {
                Header: 'Quantity',
                accessor: 'quantity',
            }, 
            {
                Header: 'Sold Price',
                accessor: 'soldPrice',
            }, 
            {
                Header: 'Shipping Charged',
                accessor: 'shippingCharged',
            },
            {
                Header: 'Shipping & Handling Fee',
                accessor: 'shippingAndHandlingFee',
            },            
            {
                Header: 'eBay Fee',
                accessor: 'ebayFee',
            },
            {
                Header: 'PayPal Fee',
                accessor: 'paypalFee',
            },
            {
                Header: 'Other Fee',
                accessor: 'otherFee',
            },
            {
                Header: 'Cost Per Item',
                accessor: 'costPerItem',
            }, 
            {
                Header: 'Total Cost',
                accessor: 'totalCost',
            },
            {
                Header: 'Net Profit',
                accessor: 'netProfit',
            },
        ];

    return columns;
}

export default salesTrackerColumns;
